import React from 'react';
import sjsResume from '../../Assets/Resume.png';
import ResumeSJS from '../../utils/sjsResume.pdf';

const handleSubmit = (event) => {
  event.ResumeSJS()
}

export default function Resume(currentPage) {
  return (
    <div>
      <h1 className="display-4 mb-4">Resume</h1>
      <a
          href="#ResumeSJS"
          onClick={() => handleSubmit('ResumeSJS')}
          // Check to see if the currentPage is `About`, and if so we use the active link class from bootstrap. Otherwise, we set it to a normal nav-link
          className={currentPage === 'Resume' ? 'nav-link active' : 'nav-link'}
        >

      <button onClick={{handleSubmit}} className="btn btn-info">Download Resume</button>
      <img src={sjsResume} className="img-fluid col-lg-5" alt="Seamona Resume"/> 
       </a>
    </div>
  );
}
